Mijn vriendjes teigetje en Poeh: Vriendelijke Verhalen 

Speelduur: 69 Minuten

Hoera! Het is een stralende dag ! Dus zet je pet op en spring op je scooter om samen met poeh, teigetje, tessa en de rest te lachen, spelen en nieuwe leuke mysteries te ontdekken midden in het honderd bunderbos.
Als er een probleem of raadsel opgelost moet worden, zijn de super speurneuzen van de partij.
Of ze nou opzoek zijn naar een piratenschat, een vermiste puppy opsporen of teigetjes hik genezen, alles is mogelijk wanneer ze samen met JOU het avontuur opzoeken.
Mijn vriendjes teigetje en Poeh: Vriendelijke Verhalen is een DVD vol plezier, heerlijke muziek en fantastische verassingen.
In deze film draait het om de magie van vriendschap en hoe leuk het is om anderen te helpen.

